import React from 'react'
import '../css/List.css'

function List(props) {
    let keyword = props.arr

    return (
        <div>
            {
                keyword.map((item, index) => {
                    return (
                        <div className="list_main" key={index}>{item}</div>
                    )
                })
            }
            <div>{keyword}</div>
        </div>
    )
}

export default List
